import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import './Login.css';

const Login = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [showPassword, setShowPassword] = useState(false); // For password visibility toggle
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();

    if (!email || !password) {
      setError('Please enter both email and password.');
      return;
    }

    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(email)) {
      setError('Please enter a valid email address.');
      return;
    }

    try {
      const response = await axios.post('http://localhost:8000/login', { email, password });

      if (response.data.success) {
        localStorage.setItem('token', response.data.token);

        // Assuming the response contains the user role
        const userRole = response.data.role;

        // Redirect based on user role
        if (userRole === 'Admin') {
          navigate('/admin-dashboard');
        } else if (userRole === 'Technician') {
          navigate('/technician-dashboard');
        } else {
          navigate('/dashboard');
        }
      } else {
        setError(response.data.message || 'Login failed.');
      }
    } catch (err) {
      setError(err.response?.data?.message || 'An error occurred during login.');
    }
  };

  return (
    <div className="login-container">
      <div className="login-box">
        <h1>Login</h1>
        <form onSubmit={handleLogin} autoComplete="off">
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            aria-label="Email"
          />
          <br />
          <div className="password-container">
            <input
              type={showPassword ? 'text' : 'password'}  // Toggle between text and password
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              aria-label="Password"
            />
            <button
              type="button"
              className="password-toggle"
              onClick={() => setShowPassword(!showPassword)}
              aria-label="Toggle password visibility"
            >
              {showPassword ? (
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="eye-icon">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M15 12c0 1.5-.4 2.9-1.1 4.1M9.1 16.1A5.973 5.973 0 0112 12c0-1.5-.4-2.9-1.1-4.1m3.8 8.2a10.002 10.002 0 000-12.2m0 0c-.6.6-1.3 1-2.1 1.3m2.1-1.3c-.8-.3-1.5-.7-2.1-1.3m2.1 12.2a10.002 10.002 0 01-12.2 0m0 0c-.6-.6-1.3-1-2.1-1.3" />
                </svg>
              ) : (
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor" className="eye-icon">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M15 12c0 1.5-.4 2.9-1.1 4.1M9.1 16.1A5.973 5.973 0 0112 12c0-1.5-.4-2.9-1.1-4.1m3.8 8.2a10.002 10.002 0 000-12.2m0 0c-.6.6-1.3 1-2.1 1.3m2.1-1.3c-.8-.3-1.5-.7-2.1-1.3m2.1 12.2a10.002 10.002 0 01-12.2 0m0 0c-.6-.6-1.3-1-2.1-1.3" />
                </svg>
              )}
            </button>
          </div>
          <br />
          <button type="submit">Login</button>
        </form>

        {error && <p style={{ color: 'red' }}>{error}</p>}

        <p>
          Don't have an account?{' '}
          <Link to="/signup" className="signup-link">
            Sign Up
          </Link>
        </p>

        {/* Forgot Password Link */}
        <p>
          <Link to="/forgot-password" className="forgot-password-link">
            Forgot Password?
          </Link>
        </p>
      </div>
    </div>
  );
};

export default Login;
